function hideSlides() {
    slide1.style.display = 'none'
    slide2.style.display = 'none'
    slide3.style.display = 'none'
    slide4.style.display = 'none'
}

function nextSlide() {
    let slide = activeSlide + 1
    goToSlide(slide)
}

function prevSlide() {
    let slide = activeSlide - 1
    goToSlide(slide)
}

function goToSlide(slide) {
    if (slide > 0 && slide < 5) {
        let activeButton = document.getElementById('slideButton' + activeSlide)
        activeButton.classList.remove('activeSlide')
        activeSlide = slide
        hideSlides()
        activeButton = document.getElementById('slideButton' + activeSlide)
        activeButton.classList.add('activeSlide')
        let slideToShow = document.getElementById('slide' + activeSlide)
        slideToShow.style.display = 'flex'
    }
}




