let motors = motor.innerHTML
let defaultMotors = motor.innerHTML

function setMarks() {
    model.innerHTML = defaultModels
    modelCut.innerHTML = defaultModelsCut
    for (let i = 0; i < values.length; i++) {
        marks = marks + '<option value="' + values[i].name + '">' + values[i].name + '</option>'
        mark.innerHTML = marks
        marksCut = marksCut + '<option value="' + values[i].name + '">' + values[i].name + '</option>'
        markCut.innerHTML = marksCut
    }
}

function setModels() {
    model.innerHTML = defaultModels
    year.innerHTML = defaultYears
    motor.innerHTML = defaultMotors
    resultWindow.style.display = 'none'
    orderBlock.style.display = 'none'
    model.removeAttribute('disabled')
    let modelsTotal = values.filter(item => item.name === mark.value)[0].models
    activeModel = modelsTotal
    for (let i = 0; i < modelsTotal.length; i++) {
        model.innerHTML = model.innerHTML + '<option value="' + modelsTotal[i].modelName + '">' + modelsTotal[i].modelName + '</option>'
    }
    year.disabled = true
    motor.disabled = true
}

function setYears() {
    year.innerHTML = defaultYears
    motor.innerHTML = defaultMotors
    resultWindow.style.display = 'none'
    orderBlock.style.display = 'none'
    year.removeAttribute('disabled')
    let yearsTotal = activeModel.filter(item => item.modelName === model.value)[0].years
    activeYear = yearsTotal
    for (let i = 0; i < yearsTotal.length; i++) {
        year.innerHTML = year.innerHTML + '<option value="' + yearsTotal[i].yearName + '">' + yearsTotal[i].yearName + '</option>'
    }
    motor.disabled = true
}

function setMotors() {
    motor.innerHTML = defaultMotors
    resultWindow.style.display = 'none'
    orderBlock.style.display = 'none'
    motor.removeAttribute('disabled')
    let motorsTotal = activeYear.filter(item => item.yearName === year.value)[0].motors
    activeMotor = motorsTotal
    for (let i = 0; i < motorsTotal.length; i++) {
        motor.innerHTML = motor.innerHTML + '<option value="' + motorsTotal[i].motorName + '">' + motorsTotal[i].motorName + '</option>'
    }
}

function setData() {

    dataTotal = activeMotor.filter(item => item.motorName === motor.value)[0].stages
    resultWindow.style.display = 'block'
    orderBlock.style.display = 'block'
    let activeClass = ''
    stagesList.innerHTML = defaultStageList
    for (let i = 0; i < dataTotal.length; i++) {
        if (i === 0)
            activeClass = 'stageActive'
        else
            activeClass = ''
        stagesList.innerHTML = stagesList.innerHTML + '<div onclick="setStage(' + i + ')" class="stageStageItem ' + activeClass + '" id="stage' + (i + 1) + '"> stage ' + (i + 1) + ' </div>'
    }
    activeStage = document.getElementById('stage1')
    setStage(0, true)
}

function setStage(stage, isDefault) {
    shredLine1.style.display = 'flex'
    shredLine2.style.display = 'flex'
    numbers.style.display = 'block'
    graphPage.style.display = 'none'
    graphSecondary.classList.remove('stageActive')
    graphSecondary.innerHTML = defaultGraphSecondary
    let graphIcon = document.getElementById('graphImage')
    graphIcon.src = 'images/graphGrey.svg'
    if (isDefault !== true) {
        activeStage.classList.remove('stageActive')
        activeStage = document.getElementById('stage' + (stage + 1))
        activeStage.classList.add('stageActive')
    }
    let stageOneContent = dataTotal[stage].split(' ')
    console.log(stageOneContent)
    for (let i = 0; i <= 19; i++) {
        let changedBlock = document.getElementById('' + (i + 1))
        if (i < stageOneContent.length)
            changedBlock.innerHTML = stageOneContent[i]
        else
            changedBlock.innerHTML = '-'
    }
    if (stageOneContent[12] === '_' && stageOneContent[13] === '_' && stageOneContent[14] === '_') {
        shredLine1.style.display = 'none'
    }
    if (stageOneContent[15] === '_' && stageOneContent[16] === '_' && stageOneContent[17] === '_') {
        shredLine2.style.display = 'none'
    }
    if (stageOneContent.length > 18) {
        graphSecondary.style.display = 'block'
        graphSecondary.innerHTML = graphSecondary.innerHTML + (stage + 1)
        graphPageImage.src = stageOneContent[18]
    } else {
        graphSecondary.style.display = 'none'
    }
}

function openGraph() {
    numbers.style.display = 'none'
    graphPage.style.display = 'block'
    activeStage.classList.remove('stageActive')
    let graphIcon = document.getElementById('graphImage')
    graphIcon.src = 'images/graphWhite.svg'
    graphSecondary.classList.add('stageActive')
}

function setModelsCut() {
    modelCut.innerHTML = defaultModelsCut
    modelCut.disabled = false
    let modelsTotal = values.filter(item => item.name === markCut.value)[0].models
    activeModelCut = modelsTotal
    for (let i = 0; i < modelsTotal.length; i++) {
        modelCut.innerHTML = modelCut.innerHTML + '<option value="' + modelsTotal[i].modelName + '">' + modelsTotal[i].modelName + '</option>'
    }
}

